import React from "react";
import Card from "../../shared/components/UIElements/Card";
import './Boroughs.css'

const Boroughs = () => {
  const DUMMY_BOROUGHS = [
    { id: "b1", name: "Manhattan", image: "" },
    {
      id: "b2",
      name: "Brooklyn",
      image: "",
    },
    {
      id: "b3",
      name: "Queens",
      image: "",
    },
  ];

  return (<Card>
      {DUMMY_BOROUGHS.map( place => {
        return(
        
          <div className="borough">
            <h2> {place.name}</h2>
          </div>
        
      )})}</Card>
  );
};

export default Boroughs;
